// viewer admin
import './Admin.css';
import RetuRnTitle from './Title';
import RetuRnAdd from './Add';
// import NewPeople from './New/Main';
import ListAdmin from './List/Main';
import ArrowBackIosIcon from '@mui/icons-material/ArrowBackIos';
import { Link } from 'react-router-dom';
import ReturnFooteR from './Footer';

// Return Admin view
export default function RetuRnAdmin() {
 return (
  <div className='wrp-admin'>
   <nav className='nav-admin'>

    <div className='next-arrow'>
     <Link to='/'>
      <ArrowBackIosIcon />
     </Link>
    </div>

    <ul>
     <li>
      <span>Membres</span>
     </li>
    </ul>
   </nav>

   <RetuRnTitle />
   <RetuRnAdd />

   {/* <NewPeople /> */}
   <ListAdmin />

   <ReturnFooteR />
  </div>
 )
};
